parts.text:
```json
{
  "application": "GenoPipe",
  "details": {
    "software": [
      "gcc/8.3.1",
      "bedtools/2.27.1",
      "bwa/0.7.15",
      "samtools/1.5",
      "anaconda3",
      "genopipe",
      "StrainID"
    ],
    "resources": {
      "nodes": "1",
      "cores": "6",
      "memory": "24gb",
      "walltime": "00:05:00",
      "account": "open"
    },
    "input": {
      "BAM file": "Simulation_$PBS_ARRAYID.bam",
      "BAM Index file": "Simulation_$PBS_ARRAYID.bam.bai",
      "Reference Genome": "$REF.fa",
      "VCF Database": "$REF\_VCF"
    },
    "output": {
      "StrainID results": "$OUTPUT/ID/Simulation_$PBS_ARRAYID.std",
      "time log": "$OUTPUT/ID/Simulation_$PBS_ARRAYID.time"
    }
  }
}
```
